import React from 'react';
import PatchEvent, { set, unset } from 'part:@sanity/form-builder/patch-event';

const PriceInput = ({ type, value, onChange, inputComponent }) => {
  const createPatchFromValue = (changedValue) =>
    PatchEvent.from(changedValue === '' ? unset() : set(Number(changedValue)));

  const formatMoney = Intl.NumberFormat('en-uk', {
    style: 'currency',
    currency: 'GBP',
  }).format;

  return (
    <div>
      <h2>
        {type.title} - {value ? formatMoney(value / 100) : ''}
      </h2>
      <p>{type.description}</p>
      <input
        type={type.name}
        value={value}
        onChange={(event) => onChange(createPatchFromValue(event.target.value))}
        ref={inputComponent}
      />
    </div>
  );
};

export default PriceInput;

PriceInput.focus = () => this._inputElement.focus();

